<script lang="ts">
import { DrivingReport } from '@/ViewModels/DrivingReport';
import { DestinationData } from '@/ViewModels/DestinationData';
import { defineComponent, reactive, ReactiveEffect, ref } from 'vue';
import InputField from './InputField.vue';
import IconDelete from './icons/IconDelete.vue';
import TextArea from './TextArea.vue';
import Checkbox from './Checkbox.vue';
import Print from './Print.vue';

export default defineComponent({
	props: {
		report: {
			type: Object,
			required: true,
			default: {},
		},
	},
	setup() {
		return {
			destinationDataIdCounter: 0,
			printWithBackground: ref(false),
		};
	},
	methods: {
		GetCurrentTime() {
			const coeff = 1000 * 60 * 5; // 5 minutes
			let date = new Date();
			let rounded = new Date(Math.round(date.getTime() / coeff) * coeff);
			return rounded.toTimeString().split(' ')[0].substring(0, 5);
		},
		AddDestinationDataRow() {
			let data = new DestinationData(this.destinationDataIdCounter);
			data.startTime = this.GetCurrentTime();
			if (this.report.destinationData.length > 0) {
				let lastData =
					this.report.destinationData[
						this.report.destinationData.length - 1
					];

				if (lastData != this.report.destinationData[0]) {
					if (
						lastData.endTime == undefined ||
						lastData.endTime == ''
					) {
						this.report.destinationData[
							this.report.destinationData.length - 1
						].endTime = data.startTime;
					}
				}
				this.report.endTime =
					this.report.destinationData[
						this.report.destinationData.length - 1
					].endTime;
			}

			this.report.destinationData.push(data);
			this.destinationDataIdCounter++;
		},
		DeleteDestinationDataRow(index: number) {
			this.report.destinationData.splice(index, 1);
		},
		StartDestination() {
			if (this.CanAddMoreRows) this.AddDestinationDataRow();
		},
		EndDestination() {
			if (this.report.destinationData.length > 0) {
				this.report.destinationData[
					this.report.destinationData.length - 1
				].endTime = this.GetCurrentTime();
				this.report.endTime =
					this.report.destinationData[
						this.report.destinationData.length - 1
					].endTime;
				this.report.endKmCount =
					this.report.destinationData[
						this.report.destinationData.length - 1
					].kmCount - this.report.destinationData[0].kmCount;
			}
		},
		AddCrossing(crossing: String, type: String) {
			this.report.crossings[crossing][type]++;
		},
		RemoveCrossing(crossing: String, type: String) {
			this.report.crossings[crossing][type]--;
		},
		Print() {
			this.$refs.print.Print();
		},
	},
	computed: {
		CanAddMoreRows() {
			if (!this.report) return false;
			if (!this.report.destinationData) return false;
			return (
				this.report.destinationData.length < this.report.maxDataCount
			);
		},
		FormattedDate() {
			if (!this.report) return;
			let date = this.report.date;
			if (typeof date == 'string') {
				date = new Date(date);
			}
			let day, month, year;
			day = date.getDate();
			month = date.getMonth() + 1;
			year = date.getFullYear();
			if (day < 10) day = '0' + day;
			if (month < 10) month = '0' + month;
			return `${day}/${month}-${year}`;
		},
		PrintCss() {
			if (this.printWithBackground) {
				return '@page {margin: 0;size: A4;}.print-container{position:absolute;top:0;left:0;width:21cm;height:29.7cm}.background-image{position:absolute;left:0;top:0;width:21cm;height:29.7cm}span{color:#000;font-weight:500;font-size:11pt;line-height:19.8pt;z-index:2}.report{position:absolute;top:3cm;right:1.3cm;font-size:20pt;text-align:right}.name{position:absolute;top:4.55cm;left:3cm;width:9.4cm}.car-reg-number{position:absolute;top:5.25cm;left:3cm;width:8.7cm}.date{position:absolute;top:4.55cm;left:13cm;width:6.6cm}.salary-number{position:absolute;top:5.25cm;left:13cm;width:6.6cm}.destination-details-list{display:flex;flex-direction:column;position:absolute;top:7.2cm;left:1.33cm}.destination-details-row{display:grid;grid-template-columns:2.15cm 4.18cm 1.42cm 1.42cm 1.93cm 1.85cm 1.85cm}.destination-details-row span{padding-left:.1cm}.end-time,.km-count,.start-time,.trip-number{text-align:center;padding:0!important}.final-end-time{position:absolute;top:15.75cm;left:9.1cm;width:1.4cm;text-align:center}.final-km-count{position:absolute;top:15.75cm;left:10.5cm;width:1.9cm;text-align:center}.crossings{display:grid;grid-template-rows: repeat(3, .72cm);position:absolute;top:18cm;left:7.8cm}.seafareCrossingName{position:absolute;left:-5.4cm;top:1.4cm;}.crossing{display:grid;grid-template-columns:3.8cm 3.8cm 3.8cm;gap:.2cm}.crossing span{width:100%;text-align:center}.additional-details{position:absolute;top:25.5cm;left:1.45cm;width:18.1cm}.additional-details span{white-space: pre-wrap;line-height:11pt;font-size:9pt}';
			} else {
				return '@page {margin: 0;size: A4;}.print-container{position:absolute;top:0;left:0;width:21cm;height:29.7cm}.background-image{display: none;}span{color:#000;font-weight:500;font-size:11pt;line-height:19.8pt;z-index:2}.report{display: none}.name{position:absolute;top:4.55cm;left:3cm;width:9.4cm}.car-reg-number{position:absolute;top:5.25cm;left:3cm;width:8.7cm}.date{position:absolute;top:4.55cm;left:13cm;width:6.6cm}.salary-number{position:absolute;top:5.25cm;left:13cm;width:6.6cm}.destination-details-list{display:flex;flex-direction:column;position:absolute;top:7.2cm;left:1.33cm}.destination-details-row{display:grid;grid-template-columns:2.15cm 4.18cm 1.42cm 1.42cm 1.93cm 1.85cm 1.85cm}.destination-details-row span{padding-left:.1cm}.end-time,.km-count,.start-time,.trip-number{text-align:center;padding:0!important}.final-end-time{position:absolute;top:15.75cm;left:9.1cm;width:1.4cm;text-align:center}.final-km-count{position:absolute;top:15.75cm;left:10.5cm;width:1.9cm;text-align:center}.crossings{display:grid;grid-template-rows: repeat(3, .72cm);position:absolute;top:18cm;left:7.8cm}.seafareCrossingName{position:absolute;left:-5.4cm;top:1.4cm;}.crossing{display:grid;grid-template-columns:3.8cm 3.8cm 3.8cm;gap:.2cm}.crossing span{width:100%;text-align:center}.additional-details{position:absolute;top:25.5cm;left:1.45cm;width:18.1cm}.additional-details span{white-space: pre-wrap;line-height:11pt;font-size:9pt}';
			}
		},
		ReportDate: {
			get() {
				return this.report.date;
			},
			set(newValue) {
				this.report.date = newValue;
				this.report.fullDate = new Date(newValue);
			},
		},
	},
	components: { InputField, IconDelete, TextArea, Checkbox, Print },
});
</script>

<template>
	<div class="report">
		<div class="report-general details">
			<h2>Generelle oplysninger</h2>
			<div class="inputs">
				<InputField
					type="number"
					v-model="report.reportNumber"
					label="Rapport nummer"
					pattern="[0-9]+"
				></InputField>
				<InputField
					type="date"
					v-model="ReportDate"
