				>
					<IconDelete
						class="delete"
						@click="DeleteDestinationDataRow(index)"
					></IconDelete>
					<div class="inputs">
						<InputField
							type="number"
							v-model="data.tripNumber"
							label="Tur nummer"
						></InputField>
						<InputField
							type="text"
							v-model="data.destination"
							label="Destination"
							max-length="21"
						></InputField>
						<InputField
							type="text"
							v-model="data.startTime"
							label="Start kl."
						></InputField>
						<InputField
							type="text"
							v-model="data.endTime"
							label="Slut kl."
						></InputField>
						<InputField
							type="number"
							v-model="data.kmCount"
							label="Km-tæller"
						></InputField>
						<InputField
							type="text"
							v-model="data.trailerNumber"
							label="Trailer nummer"
						></InputField>
						<InputField
							type="text"
							v-model="data.linkTrailer"
							label="Link Trailer"
						></InputField>
					</div>
				</div>
			</div>
			<div v-else class="no-destinations">
				<h2>
					Der er ikke tilføjet nogle destinationer endnu. Klik på
					'START DESTINATION' for at tilføje en destination.
				</h2>
			</div>
			<div class="data-list-overall">
				<div
					class="btn start-btn"
					:class="{ disabled: !CanAddMoreRows }"
					@click="StartDestination"
				>
					Start destination
				</div>
				<div class="btn end-btn" @click="EndDestination">
					Slut destination
				</div>
				<InputField
					type="number"
					v-model="report.endKmCount"
					label="Sluttidspunkt km-tæller"
				></InputField>
			</div>
		</div>
		<div class="crossings details">
			<h2>Overfarter</h2>
			<div class="crossings-list">
				<div
					class="crossing"
					v-for="(crossing, key) in report.crossings"
					:class="key"
				>
					<legend>
						{{
							key.toString().charAt(0).toUpperCase() +
							key.toString().slice(1)
						}}
					</legend>
					<div
						class="crossing-input-container"
						v-for="(crossingType, crossingTypeKey) in crossing"
					>
						<InputField
							type="number"
							v-model="report.crossings[key][crossingTypeKey]"
							:label="crossingTypeKey"
						></InputField>
						<div class="crossing-btn-container">
							<div
								class="btn"
								@click="AddCrossing(key, crossingTypeKey)"
							>
								+1
							</div>
							<div
								class="btn"
								@click="RemoveCrossing(key, crossingTypeKey)"
							>
								-1
							</div>
						</div>
					</div>
					<InputField
						v-if="key == 'færge'"
						type="text"
						v-model="report.seafareCrossingName"
						label="Færge navn"
						class="seafareCrossingName"
					></InputField>
				</div>
			</div>
		</div>
		<div class="extra-details details">
			<h2>Øvrige bemærkninger</h2>
			<TextArea
				class="text-area"
				:max-chars="425"
				v-model="report.additionalDetails"
			></TextArea>
		</div>
		<div class="print">
			<Checkbox
				v-model="printWithBackground"
				label="Print med baggrund"
				name="printWithBackground"
			></Checkbox>
			<div class="btn print-btn" @click="Print">Print</div>
		</div>
	</div>
	<Print ref="print" :print-style="PrintCss" class="print">
		<template v-slot:print class="print">
