			<span class="car-reg-number">{{ report.carRegNumber }}</span>
			<span class="date">{{ FormattedDate }}</span>
			<span class="salary-number">{{ report.salaryNumber }}</span>
			<div class="destination-details-list">
				<div
					class="destination-details-row"
					v-for="destination in report.destinationData"
				>
					<span class="trip-number">{{
						destination.tripNumber
					}}</span>
					<span class="destination">{{
						destination.destination
					}}</span>
					<span class="start-time">{{ destination.startTime }}</span>
					<span class="end-time">{{ destination.endTime }}</span>
					<span class="km-count">{{ destination.kmCount }}</span>
					<span class="trailer-number">{{
						destination.trailerNumber
					}}</span>
					<span class="link-trailer">{{
						destination.linkTrailer
					}}</span>
				</div>
			</div>
			<span class="final-km-count">{{ report.endKmCount }}</span>
			<div class="crossings">
				<div class="crossing" v-for="crossing in report.crossings">
					<span>{{ crossing.Solo > 0 ? crossing.Solo : null }}</span
					><span>{{
						crossing.Trailer > 0 ? crossing.Trailer : null
					}}</span
					><span>{{
						crossing.Modul > 0 ? crossing.Modul : null
					}}</span>
				</div>
				<span class="seafareCrossingName">{{report.seafareCrossingName}}</span>
			</div>
			<div class="additional-details">
				<span>{{ report.additionalDetails }}</span>
			</div>
		</template>
	</Print>
</template>

